import React from 'react';
import './App.css';
import Jobs from "../src/Components/Jobs";

let mockJobs = [];

const obj = [
  {title: "SW1", company: 1},
  {title: "SW1", company: 1},
  {title: "SW1", company: 1},
  {title: "SW1", company: 1},
  {title: "SW1", company: 1},
  {title: "SW1", company: 1},
]

export default class App extends React.Component {

  componentDidMount() {

    this.handleLoad();
  }

  handleLoad = async () => {

    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    const url = "https://jobs.github.com/positions.json"; // site that doesn’t send Access-Control-*
    fetch(proxyurl + url) // https://cors-anywhere.herokuapp.com/https://example.com
      .then(response => response.json())
      .then(contents => {
        mockJobs = Object.keys(contents).map(function(key){
          return contents[key]
        });
        console.log(mockJobs)
      });
  }

  render() {
    return (
      <div className="App">
        <Jobs jobs={obj} />
      </div>
    )
  }
}
